INSERT INTO `R_JOBENTRY_ATTRIBUTE` (`ID_JOBENTRY_ATTRIBUTE`, `ID_JOB`, `ID_JOBENTRY`, `NR`, `CODE`, `VALUE_NUM`, `VALUE_STR`) VALUES (6961,18,324,0,'sql',0,'delete from\n stg_cmis_documents\nwhere\n alfresco_id = ${alfresco_id}\n and cmis_objectid in (select p.cmis_objectid from stg_cmis_documents_partial p where p.alfresco_id = ${alfresco_id} and cmis_creationdate is not null)\n and cmis_creationdate is not null;\ndelete from\n stg_cmis_documents\nwhere\n alfresco_id = ${alfresco_id}\n and cmis_objectid in (select p.cmis_objectid from stg_cmis_documents_partial p where p.alfresco_id = ${alfresco_id} and cmis_creationdate is null)\n and cmis_creationdate is null;\ndelete from\n stg_cmis_folders\nwhere\n alfresco_id = ${alfresco_id}\n and cmis_objectid in (select p.cmis_objectid from stg_cmis_folders_partial p where p.alfresco_id = ${alfresco_id} and cmis_creationdate is not null)\n and cmis_creationdate is not null;\ndelete from\n stg_cmis_folders\nwhere\n alfresco_id = ${alfresco_id}\n and cmis_objectid in (select p.cmis_objectid from stg_cmis_folders_partial p where p.alfresco_id = ${alfresco_id} and cmis_creationdate is null)\n and cmis_creationdate is null;\n');
