INSERT INTO `R_JOBENTRY_ATTRIBUTE` (`ID_JOBENTRY_ATTRIBUTE`, `ID_JOB`, `ID_JOBENTRY`, `NR`, `CODE`, `VALUE_NUM`, `VALUE_STR`) VALUES (10384,7,482,0,'sql',0,'update dm_dim_paths\nset document_id = null\nwhere\n document_id in (\n select distinct id\n from dm_dim_documents\n where alfresco_id = ${alfresco_id} and src_id not in (select cmis_objectid from stg_cmis_documents where alfresco_id = ${alfresco_id}));\n\nupdate dm_dim_paths\nset folder_id = null\nwhere\n folder_id in (\n select distinct id\n from dm_dim_folders\n where alfresco_id = ${alfresco_id} and src_id not in (select cmis_objectid from stg_cmis_folders where alfresco_id = ${alfresco_id}));');
