INSERT INTO `R_JOBENTRY_ATTRIBUTE` (`ID_JOBENTRY_ATTRIBUTE`, `ID_JOB`, `ID_JOBENTRY`, `NR`, `CODE`, `VALUE_NUM`, `VALUE_STR`) VALUES (10391,7,483,0,'sql',0,'update\n dm_dim_paths\nset\n document_id = (select max(d.id)\n  from\n   dm_dim_documents d,\n   stg_cmis_documents stgD\n  where\n   d.alfresco_id = stgD.alfresco_id\n   and d.src_id = stgD.cmis_objectid\n   and dm_dim_paths.path = d.path)\nwhere dm_dim_paths.path in (\n select path\n from\n  dm_dim_documents d,\n  stg_cmis_documents stgD\n where\n  d.alfresco_id = stgD.alfresco_id\n  and d.src_id = stgD.cmis_objectid);\n\nupdate\n dm_dim_paths\nset\n folder_id = (select max(f.id)\n  from\n   dm_dim_folders f,\n   stg_cmis_folders stgF\n  where\n   f.alfresco_id = stgF.alfresco_id\n   and f.src_id = stgF.cmis_objectid\n   and dm_dim_paths.path = f.path)\nwhere dm_dim_paths.path in (\n select path\n from\n  dm_dim_folders f,\n  stg_cmis_folders stgF\n where\n  f.alfresco_id = stgF.alfresco_id\n  and f.src_id = stgF.cmis_objectid);\n\n');
