INSERT INTO `R_STEP_ATTRIBUTE` (`ID_STEP_ATTRIBUTE`, `ID_TRANSFORMATION`, `ID_STEP`, `NR`, `CODE`, `VALUE_NUM`, `VALUE_STR`) VALUES (153,1,9,0,'sql',0,'select \n ${alfresco_id} as alfresco_id,\n \'UNKNOWN\' as `user`\nunion all\nselect distinct\n alfresco_id,\n `user`\nfrom\n (\n  select distinct alfresco_id, `user` from ope_audits where alfresco_id = ${alfresco_id}\n  union all\n  select distinct alfresco_id, upper(cmis_lastmodifiedby) as `user` from stg_cmis_folders where alfresco_id = ${alfresco_id}\n  union all\n  select distinct alfresco_id, upper(cmis_createdby) as `user` from stg_cmis_folders where alfresco_id = ${alfresco_id}\n  union all\n  select distinct alfresco_id, upper(cmis_lastmodifiedby) as `user` from stg_cmis_documents where alfresco_id = ${alfresco_id}\n  union all\n  select distinct alfresco_id, upper(cmis_createdby) as `user` from stg_cmis_documents where alfresco_id = ${alfresco_id}\n ) t\nwhere\n `user` is not null\n\n');
