INSERT INTO `R_STEP_ATTRIBUTE` (`ID_STEP_ATTRIBUTE`, `ID_TRANSFORMATION`, `ID_STEP`, `NR`, `CODE`, `VALUE_NUM`, `VALUE_STR`) VALUES (338,2,20,0,'sql',0,'select\n 2000 as \"year\",\n \'UNKNOWN\' as \"desc\"\nunion all\nselect\n @num := @num + 1 as \"year\",\n @num as \"desc\"\nfrom\n generator_16,\n (select @num:=(select date_format(min(dt_time),\'%Y\') from (select min(time) as dt_time from stg_audits where alfresco_id = ${alfresco_id} union all select min(cmis_creationdate) as dt_time from stg_cmis_documents where alfresco_id=${alfresco_id} union all select min(cmis_creationdate) as dt_time from stg_cmis_folders where alfresco_id=${alfresco_id}) dt )-1) num\nwhere\n @num < date_format(current_date(),\'%Y\')\n');
