INSERT INTO `R_STEP_ATTRIBUTE` (`ID_STEP_ATTRIBUTE`, `ID_TRANSFORMATION`, `ID_STEP`, `NR`, `CODE`, `VALUE_NUM`, `VALUE_STR`) VALUES (418,4,25,0,'sql',0,'select\n cast(\'2000-01-01\' as date) as \"date\",\n \'UNKNOWN\' as \"desc\",\n \'UNKNOWN\' as \"day_desc\",\n cast(\'2000-01-01\' as date) as \"month_id\"\nunion all\nselect\n @dt := date_add(@dt,interval 1 day) as \"date\",\n date_format(@dt,\'%Y-%m-%d\') as \"desc\",\n upper(date_format(@dt,\'%d %b %Y\')) as \"day_desc\",\n cast(concat(date_format(@dt,\'%Y-%m\'),\'-01\') as date) as \"month_id\"\nfrom\n generator_65536,\n (select @dt := date_add(cast((select date_format(min(dt_time),\'%Y-%m-%d\')\n   from (\n    select min(time) as dt_time from stg_audits where alfresco_id=${alfresco_id}\n    union all\n    select min(cmis_creationdate) as dt_time from stg_cmis_documents where alfresco_id=${alfresco_id}\n    union all\n    select min(cmis_creationdate) as dt_time from stg_cmis_folders where alfresco_id=${alfresco_id}\n    ) t) as date),interval -1 day)) dt\nwhere\n @dt < current_date');
