INSERT INTO `R_STEP_ATTRIBUTE` (`ID_STEP_ATTRIBUTE`, `ID_TRANSFORMATION`, `ID_STEP`, `NR`, `CODE`, `VALUE_NUM`, `VALUE_STR`) VALUES (579,5,31,0,'sql',0,'select\n ${alfresco_id} as alfresco_id,\n \'Unknown\' as src_id,\n \'Unknown\' as \"name\",\n \'Unknown\' as \"path\",\n \'Unknown\' as node_type,\n upper(\'Unknown\') as user_creator,\n date(\'2000-01-01\') as creation_date_id,\n -1 as creation_minute_id,\n upper(\'Unknown\') as user_last_modifier,\n date(\'2000-01-01\') as last_modification_date_id,\n -1 as last_modification_minute_id\nunion all\nselect\n alfresco_id,\n cmis_objectid as src_id,\n cmis_name as \"name\",\n coalesce(cmis_path,\'Unknown\') as \"path\",\n cmis_objecttypeid as node_type,\n upper(cmis_createdby) as user_creator,\n date(cmis_creationdate) as creation_date_id,\n (extract(hour from cmis_creationdate) * 60) + extract(minute from cmis_creationdate) as creation_minute_id,\n upper(cmis_lastmodifiedby) as user_last_modifier,\n date(cmis_lastmodificationdate) as last_modification_date_id,\n (extract(hour from cmis_lastmodificationdate) * 60) + extract(minute from cmis_lastmodificationdate) as last_modification_minute_id\nfrom\n stg_cmis_folders\nwhere\n alfresco_id = ${alfresco_id}\n and cmis_creationdate is not null');
