INSERT INTO `R_STEP_ATTRIBUTE` (`ID_STEP_ATTRIBUTE`, `ID_TRANSFORMATION`, `ID_STEP`, `NR`, `CODE`, `VALUE_NUM`, `VALUE_STR`) VALUES (863,7,44,0,'sql',0,'select\n stg_cmis_documents.alfresco_id as alfresco_id,\n stg_cmis_documents.cmis_objectid as src_id,\n cmis_name as \"name\",\n coalesce(cmis_path,\'Unknown\') as path,\n cmis_objecttypeid as node_type,\n coalesce(upper(cmis_contentstreammimetype),\'UNKNOWN\') as mime_type,\n upper(cmis_createdby) as user_creator,\n date(cmis_creationdate) as creation_date_id,\n (extract(hour from cmis_creationdate) * 60) + extract(minute from cmis_creationdate) as creation_minute_id,\n upper(cmis_lastmodifiedby)as user_last_modifier,\n date(cmis_lastmodificationdate) as last_modification_date_id,\n (extract(hour from cmis_lastmodificationdate) * 60) + extract(minute from cmis_lastmodificationdate) as last_modification_minute_id,\n cmis_contentstreamlength as content_stream_length,\n upper(cmis_islatestversion) as is_latest_version,\n upper(cmis_ismajorversion) as is_major_version,\n upper(cmis_islatestmajorversion) as is_latest_major_version,\n upper(cmis_isimmutable) as is_immutable,\n coalesce(cmis_parentid,\'Unknown\') as parent,\n \'Unknown\' as parent_unknown\nfrom\n stg_cmis_documents\n left join ope_cmis_document_parent on stg_cmis_documents.alfresco_id = ope_cmis_document_parent.alfresco_id and stg_cmis_documents.cmis_objectid = ope_cmis_document_parent.cmis_objectid\nwhere\n stg_cmis_documents.alfresco_id = ${alfresco_id}\n and cmis_creationdate is not null\n');
