INSERT INTO `R_STEP_ATTRIBUTE` (`ID_STEP_ATTRIBUTE`, `ID_TRANSFORMATION`, `ID_STEP`, `NR`, `CODE`, `VALUE_NUM`, `VALUE_STR`) VALUES (1066,9,54,0,'sql',0,'select\n ${target_table}.alfresco_id,\n ${target_table}.src_id\nfrom\n ${target_table} join ${dimensional_table} on ${target_table}.alfresco_id = ${dimensional_table}.alfresco_id and ${target_table}.${join_field} = ${dimensional_table}.id\nwhere\n ${target_table}.alfresco_id = ${alfresco_id}\n and ${dimensional_table}.src_id in (\n  select ${source_table}.cmis_objectid\n  from ${source_table}\n  where ${source_table}.alfresco_id = ${alfresco_id} ${where_condition})\n and ${target_table}.src_id not in (\n  select ${source_table}.tuple_id\n  from ${source_table}\n  where ${source_table}.alfresco_id = ${alfresco_id} ${where_condition})');
