INSERT INTO `R_STEP_ATTRIBUTE` (`ID_STEP_ATTRIBUTE`, `ID_TRANSFORMATION`, `ID_STEP`, `NR`, `CODE`, `VALUE_NUM`, `VALUE_STR`) VALUES (1077,9,55,0,'sql',0,'select\n ${source_table}.*,\n ${source_table}.tuple_id as src_id,\n coalesce(${dimensional_table}.id, null) as lookup_id\nfrom\n ${source_table} join ${dimensional_table} on ${source_table}.alfresco_id=${dimensional_table}.alfresco_id and ${source_table}.cmis_objectid=${dimensional_table}.src_id\nwhere\n ${source_table}.alfresco_id = ${alfresco_id}\n and tuple_id not in (\n  select src_id\n  from ${target_table}\n  where alfresco_id = ${alfresco_id})\n ${where_condition}');
