INSERT INTO `R_STEP_ATTRIBUTE` (`ID_STEP_ATTRIBUTE`, `ID_TRANSFORMATION`, `ID_STEP`, `NR`, `CODE`, `VALUE_NUM`, `VALUE_STR`) VALUES (1127,10,57,0,'jsScript_script',0,'var JSON = JSON || {};\n\n// implement JSON.stringify serialization  \nJSON.stringify = JSON.stringify || function (obj) {  \n    var t = typeof (obj);  \n    if (t != \"object\" || obj === null) {  \n        // simple data type  \n        if (t == \"string\") obj = \'\"\'+obj+\'\"\';  \n        return String(obj);  \n    }  \n    else {  \n        // recurse array or object  \n        var n, v, json = [], arr = (obj && obj.constructor == Array);  \n        for (n in obj) {  \n            v = obj[n]; t = typeof(v);  \n            if (t == \"string\") v = \'\"\'+v+\'\"\';  \n            else if (t == \"object\" && v !== null) v = JSON.stringify(v);  \n            json.push((arr ? \"\" : \'\"\' + n + \'\":\') + String(v));  \n        }  \n        return (arr ? \"[\" : \"{\") + String(json) + (arr ? \"]\" : \"}\");  \n    }  \n};  \n\n// Eval the json string in a json object.\nvar jsonEntriesLst = eval(\'(\' + fileContent + \')\');\n\nvar fieldNum = 0;\nfor (var i = 0; i < jsonEntriesLst.entries.length; ++i)\n{\n  // Generate a new row.\n  newRow = createRowCopy(getOutputRowMeta().size());\n\n  fieldNum = getInputRowMeta().size();\n  newRow[0] = \'\';\n  newRow[fieldNum++] = parseInt(getVariable(\"alfresco_id\",\"\"));\n  newRow[fieldNum++] = jsonEntriesLst.entries[i].id;\n  newRow[fieldNum++] = jsonEntriesLst.entries[i].application;\n  newRow[fieldNum++] = jsonEntriesLst.entries[i].user;\n  newRow[fieldNum++] = jsonEntriesLst.entries[i].time;\n  newRow[fieldNum++] = JSON.stringify(jsonEntriesLst.entries[i].values);\n\n  putRow(newRow);\n}\n\n// Skip the current row.\ntrans_Status = SKIP_TRANSFORMATION;\n');
