INSERT INTO `R_STEP_ATTRIBUTE` (`ID_STEP_ATTRIBUTE`, `ID_TRANSFORMATION`, `ID_STEP`, `NR`, `CODE`, `VALUE_NUM`, `VALUE_STR`) VALUES (1250,11,60,0,'jsScript_script',0,'\nvar jsonValues = eval(\'(\' + values + \')\');\n\nif (typeof(jsonValues[\"/alfresco-access/transaction/action\"]) != \'undefined\')\n{\n  action = upper(jsonValues[\"/alfresco-access/transaction/action\"]);\n  path = jsonValues[\"/alfresco-access/transaction/path\"].replace(/\\/app\\:company\\_home/gi,\"\");\n  path = path.replace(/\\/[a-zA-Z]{2,3}\\:/gi,\"/\");\n}\nelse if (typeof(jsonValues[\"/alfresco-access/login/user\"]) != \'undefined\')\n{\n  action = \"LOGIN\";\n  path = \"\";\n}\nelse if (typeof(jsonValues[\"/alfresco-access/loginFailure/user\"]) != \'undefined\')\n{\n  action = \"LOGINFAILURE\";\n  if (user == null)\n  {\n    var user = (upper(jsonValues[\"/alfresco-access/loginFailure/user\"]));\n  }\n  else\n  {\n    user.setValue(upper(jsonValues[\"/alfresco-access/loginFailure/user\"]));\n  }\n  path = \"\";\n}\nelse if (typeof(jsonValues[\"/alfresco-access/logout/user\"]) != \'undefined\')\n{\n  action = \"LOGOUT\";\n  path = \"\";\n}\nelse\n{\n  action = \"UNKNOWN\";\n  path = \"\";\n}');
