INSERT INTO `R_STEP_ATTRIBUTE` (`ID_STEP_ATTRIBUTE`, `ID_TRANSFORMATION`, `ID_STEP`, `NR`, `CODE`, `VALUE_NUM`, `VALUE_STR`) VALUES (2042,21,104,0,'sql',0,'select\n concat((select max(data) from (select max(last_modification_date_id) as \"data\" from dm_dim_documents where alfresco_id = ${alfresco_id} union all select max(last_modification_date_id) as \"data\" from dm_dim_folders where alfresco_id = ${alfresco_id} union all select str_to_date(\'2001-01-01\',\'%Y-%m-%d\')) t),\'T00:00:00.000+00:00\') as cmis_last_update,\n (select max(data) from (select max(last_modification_date_id) as \"data\" from dm_dim_documents where alfresco_id = ${alfresco_id} union all select max(last_modification_date_id) as \"data\" from dm_dim_folders where alfresco_id = ${alfresco_id} union all select str_to_date(\'2001-01-01\',\'%Y-%m-%d\')) t) as last_update,\n 0 as documents_cmis_contentstreamlength,\n \'\' as documents_name,\n concat((select max(data) from (select max(last_modification_date_id) as \"data\" from dm_dim_folders where alfresco_id = ${alfresco_id} union all select str_to_date(\'2001-01-01\',\'%Y-%m-%d\')) t),\'T00:00:00.000+00:00\') as folders_cmis_lastmodificationdate,\n (select max(data) from (select max(last_modification_date_id) as \"data\" from dm_dim_folders where alfresco_id = ${alfresco_id} union all select str_to_date(\'2001-01-01\',\'%Y-%m-%d\')) t) as folders_lastmodificationdate,\n \'\' as folders_name\n');
