.cmis_creationdate is not null)\n  )\n union all\n select\n  ${alfresco_id} as alfresco_id,\n  str_to_date(\'2001-01-01\',\'%Y-%m-%d\') as new_modified_folders_lastmodificationdate,\n  \'2001-01-01T00:00:00.000+00:00\' as new_modified_folders_cmis_lastmodificationdate,\n  \'\' as new_modified_folders_name,\n  0 as new_modified_folders_partial_count,\n  0 as new_modified_folders_count\n ) t\norder by\n new_modified_folders_cmis_lastmodificationdate desc\nlimit\n 1');
