INSERT INTO `R_STEP_ATTRIBUTE` (`ID_STEP_ATTRIBUTE`, `ID_TRANSFORMATION`, `ID_STEP`, `NR`, `CODE`, `VALUE_NUM`, `VALUE_STR`) VALUES (2388,23,128,0,'sql',0,'select\n alfresco_id,\n new_modified_documents_cmis_contentstreamlength,\n new_modified_documents_name,\n new_modified_documents_partial_count,\n new_modified_documents_count\nfrom\n (select\n  p1.alfresco_id as alfresco_id,\n  coalesce(p1.cmis_contentstreamlength,0) as new_modified_documents_cmis_contentstreamlength,\n  coalesce(p1.cmis_name,\'\') as new_modified_documents_name,\n  coalesce((select count(*) from ${staging_aspect_partial_table} p2 where p2.alfresco_id = p1.alfresco_id and p2.cmis_contentstreamlength = p1.cmis_contentstreamlength and p2.cmis_name = p1.cmis_name and p2.cmis_creationdate is not null and p2.cmis_basetypeid=\'cmis:document\'),0) as new_modified_documents_partial_count,\n  coalesce((select count(*) from ${staging_aspect_table} p2 where p2.alfresco_id = p1.alfresco_id and p2.cmis_contentstreamlength = p1.cmis_contentstreamlength and p2.cmis_name = p1.cmis_name and p2.cmis_creationdate is not null and p2.cmis_basetypeid=\'cmis:document\'),0) as new_modified_documents_count\n from\n  ${staging_aspect_partial_table} p1\n where\n  p1.alfresco_id = ${alfresco_id}\n  and p1.cmis_objectid = (\n   select max(p2.cmis_objectid)\n   from ${staging_aspect_partial_table} p2\n   where\n    p2.alfresco_id = ${alfresco_id}\n    and p2.cmis_basetypeid=\'cmis:document\'\n    and p2.cmis_contentstreamlength = (select max(p3.cmis_contentstreamlength) from ${staging_aspect_partial_table} p3 where p3.alfresco_id = p2.alfresco_id and p3.cmis_creationdate is not null and p3.cmis_basetypeid=\'cmis:document\')\n    and upper(p2.cmis_name) = (select max(upper(p3.cmis_name)) from ${staging_aspect_partial_table} p3 where p3.alfresco_id = p2.alfresco_id and p3.cmis_contentstreamlength = p2.cmis_contentstreamlength and p3.cmis_creationdate is not null and p3.cmis_basetypeid=\'cmis:document\')\n  )\n union all\n select\n  ${alfresco_id} as alfresco_id,\n  0 as new_modified_documents_cmis_contentstreamlength,\n  \'\' as new_modified_documents_name,\n  0 as new_modified_documents_partial_count,\n  0 as new_modified_documents_count\n ) t\norder by\n new_modified_documents_cmis_contentstreamlength desc\nlimit\n 1');
