INSERT INTO `R_STEP_ATTRIBUTE` (`ID_STEP_ATTRIBUTE`, `ID_TRANSFORMATION`, `ID_STEP`, `NR`, `CODE`, `VALUE_NUM`, `VALUE_STR`) VALUES (2398,23,129,0,'id_connection',1,NULL);
INSERT INTO `R_STEP_ATTRIBUTE` (`ID_STEP_ATTRIBUTE`, `ID_TRANSFORMATION`, `ID_STEP`, `NR`, `CODE`, `VALUE_NUM`, `VALUE_STR`) VALUES (2399,23,129,0,'sql',0,'select\n alfresco_id,\n new_modified_folders_lastmodificationdate,\n new_modified_folders_cmis_lastmodificationdate,\n new_modified_folders_name,\n new_modified_folders_partial_count,\n new_modified_folders_count\nfrom\n (select\n  p1.alfresco_id as alfresco_id,\n  coalesce(p1.cmis_lastmodificationdate,str_to_date(\'2001-01-01\',\'%Y-%m-%d\')) as new_modified_folders_lastmodificationdate,\n  concat(date_format(coalesce(p1.cmis_lastmodificationdate,str_to_date(\'2001-01-01\',\'%Y-%m-%d\')),\'%Y-%m-%d\'),\'T00:00:00.000+00:00\') as new_modified_folders_cmis_lastmodificationdate,\n  coalesce(p1.cmis_name,\'\') as new_modified_folders_name,\n  coalesce((select count(*) from ${staging_aspect_partial_table} p2 where p2.alfresco_id = p1.alfresco_id and p2.cmis_name = p1.cmis_name and p2.cmis_lastmodificationdate = p1.cmis_lastmodificationdate and p2.cmis_creationdate is not null and p2.cmis_basetypeid=\'cmis:folder\'),0) as new_modified_folders_partial_count,\n  coalesce((select count(*) from ${staging_aspect_table} p2 where p2.alfresco_id = p1.alfresco_id and p2.cmis_name = p1.cmis_name and p2.cmis_lastmodificationdate = p1.cmis_lastmodificationdate and p2.cmis_creationdate is not null and p2.cmis_basetypeid=\'cmis:folder\'),0) as new_modified_folders_count\n from\n  ${staging_aspect_partial_table} p1\n where\n  p1.alfresco_id = ${alfresco_id}\n  and p1.cmis_objectid = (\n   select max(p2.cmis_objectid)\n   from ${staging_aspect_partial_table} p2\n   where\n    p2.alfresco_id = ${alfresco_id}\n    and p2.cmis_basetypeid=\'cmis:folder\'\n    and p2.cmis_lastmodificationdate = (select max(p3.cmis_lastmodificationdate) from ${staging_aspect_partial_table} p3 where p3.alfresco_id = p2.alfresco_id and p3.cmis_creationdate is not null and p3.cmis_basetypeid=\'cmis:folder\')\n    and upper(p2.cmis_name) = (select max(upper(p3.cmis_name)) from ${staging_aspect_partial_table} p3 where p3.alfresco_id = p2.alfresco_id and p3.cmis_lastmodificationdate = p2.cmis_lastmodificationdate and p3.cmis_creationdate is not null and p3.cmis_basetypeid=\'cmis:folder\')\n  )\n union all\n select\n  ${alfresco_id} as alfresco_id,\n  str_to_date(\'2001-01-01\',\'%Y-%m-%d\') as new_modified_folders_lastmodificationdate,\n  \'2001-01-01T00:00:00.000+00:00\' as new_modified_folders_cmis_lastmodificationdate,\n  \'\' as new_modified_folders_name,\n  0 as new_modified_folders_partial_count,\n  0 as new_modified_folders_count\n ) t\norder by\n new_modified_folders_cmis_lastmodificationdate desc\nlimit\n 1');
