INSERT INTO `R_STEP_ATTRIBUTE` (`ID_STEP_ATTRIBUTE`, `ID_TRANSFORMATION`, `ID_STEP`, `NR`, `CODE`, `VALUE_NUM`, `VALUE_STR`) VALUES (2629,27,144,0,'jsScript_name',0,'Script 1');
INSERT INTO `R_STEP_ATTRIBUTE` (`ID_STEP_ATTRIBUTE`, `ID_TRANSFORMATION`, `ID_STEP`, `NR`, `CODE`, `VALUE_NUM`, `VALUE_STR`) VALUES (2630,27,144,0,'jsScript_script',0,'\n// Tuple id prefix.\nnew_tuple_id = cmis_objectid;\n\n// Tuple id with hash of the couples: \'field_value\'.\nvar tuple_to_encode = \"\";\nfor (var i=0; i < getInputRowMeta().size(); ++i) {\n  var valueMeta = getInputRowMeta().getValueMeta(i);\n  if (!valueMeta.getName().startsWith(\"cmis_\") && \n      !valueMeta.getName().equals(\"alfresco_id\") && \n      !valueMeta.getName().equals(\"tuple_id\") && \n      !valueMeta.getName().equals(\"id\")) {\n    tuple_to_encode += \"_\" + valueMeta.getName() + \"_\" + row[i];\n  }\n}\ntuple_to_encode = tuple_to_encode.substring(1);\nnew_tuple_id += \"_\" + getHashCode(tuple_to_encode);\n\n// =================================\n\nfunction getHashCode(string_to_encode) {\n  var hash = 0;\n  if (string_to_encode.length == 0) return hash;\n  for (i = 0; i < string_to_encode.length; i++) {\n    char = string_to_encode.charCodeAt(i);\n    hash = ((hash<<5)-hash)+char;\n    hash = hash & hash; // Convert to 32bit integer\n  }\n  return hash;\n};');
