INSERT INTO `R_STEP_ATTRIBUTE` (`ID_STEP_ATTRIBUTE`, `ID_TRANSFORMATION`, `ID_STEP`, `NR`, `CODE`, `VALUE_NUM`, `VALUE_STR`) VALUES (2850,31,161,0,'sql',0,'select \n concat(pentaho_url,\'/api/repo/files/\',replace(pentaho_path,\'/\',\':\'),\':\',prpt_name) as http_prpt,\n pentaho_login as http_login,\n pentaho_password as http_password,\n prpt_name,\n name as report_name,\n substring_index(lower(name), \'.\', -1) as extension,\n concat(\'^\',replace(name,\'.\',\'(.+)\'),\'$\') as report_regex,\n alfresco_ftp,\n alfresco_port,\n alfresco_login, \n alfresco_password,\n alfresco_path\nfrom dm_reports\nwhere id = ${reportId}');
