INSERT INTO `R_STEP_ATTRIBUTE` (`ID_STEP_ATTRIBUTE`, `ID_TRANSFORMATION`, `ID_STEP`, `NR`, `CODE`, `VALUE_NUM`, `VALUE_STR`) VALUES (2863,31,162,0,'jsScript_script',0,'prpt_path = getVariable(\"java.io.tmpdir\",\"\");\nif (!prpt_name.substring(prpt_name.length-1).equals(getVariable(\"file.separator\",\"\"))) {\n	prpt_path += getVariable(\"file.separator\",\"\");\n}\nprpt_path += prpt_name;\n\nreport_path = getVariable(\"java.io.tmpdir\",\"\");\nif (!report_name.substring(report_name.length-1).equals(getVariable(\"file.separator\",\"\"))) {\n	report_path += getVariable(\"file.separator\",\"\");\n}\nreport_path += report_name;\n');
