INSERT INTO `R_STEP_ATTRIBUTE` (`ID_STEP_ATTRIBUTE`, `ID_TRANSFORMATION`, `ID_STEP`, `NR`, `CODE`, `VALUE_NUM`, `VALUE_STR`) VALUES (3119,3,182,0,'sql',0,'select\n -1 as \"minute\",\n \'UNKNOWN\' as \"desc\",\n -1 as \"hour_id\"\nunion all\nselect  \n n as \"minute\",\n concat(if (n div 60 < 10,concat(\'0\',n div 60),n div 60),\':\',if (n mod 60 < 10,concat(\'0\',n mod 60),n mod 60)) as \"desc\",\n n div 60 as \"hour_id\"\nfrom\n generator_65536\nwhere\n n < (24 * 60)');
