INSERT INTO `R_STEP_ATTRIBUTE` (`ID_STEP_ATTRIBUTE`, `ID_TRANSFORMATION`, `ID_STEP`, `NR`, `CODE`, `VALUE_NUM`, `VALUE_STR`) VALUES (3130,3,183,0,'sql',0,'select\n cast(\'2000-01-01\' as date) as \"month\",\n \'UNKNOWN\' as \"desc\",\n \'UNKNOWN\' as \"month_desc\",\n 2000 as \"year_id\"\nunion all\nselect\n @dt := date_add(@dt,interval 1 month) as \"month\",\n date_format(@dt,\'%m-%Y\') as \"desc\",\n upper(date_format(@dt,\'%b %Y\')) as \"month_desc\",\n cast(date_format(@dt,\'%Y\') as unsigned) as \"year_id\"\nfrom\n generator_256,\n (select @dt := date_add(cast((select concat(date_format(min(dt_time),\'%Y-%m\'),\'-01\') from (\n   select min(time) as dt_time from stg_audits where alfresco_id=${alfresco_id}\n   union all\n   select min(cmis_creationdate) as dt_time from stg_cmis_documents where alfresco_id=${alfresco_id}\n   union all\n   select min(cmis_creationdate) as dt_time from stg_cmis_folders where alfresco_id=${alfresco_id}\n   ) t) as date),interval -1 month)) dt\nwhere\n @dt <= (current_date - interval 1 month)');
