INSERT INTO `R_STEP_ATTRIBUTE` (`ID_STEP_ATTRIBUTE`, `ID_TRANSFORMATION`, `ID_STEP`, `NR`, `CODE`, `VALUE_NUM`, `VALUE_STR`) VALUES (3593,33,235,0,'jsScript_script',0,'// Base type check.\nvar baseTypeIdPosition = getInputRowMeta().indexOfValue(\"cmis:baseTypeId\");\nif (baseTypeIdPosition < 0) {\n  throw \"Base type field is not in the row while was expected.\";\n}\nif (row[baseTypeIdPosition].equals(\"cmis:document\") && !getVariable(\"is_document_type\",\"\").equals(\'Y\')) {\n  throw \"Base type field with value \'cmis:document\' but \'is_document_type\'=\'\" + getVariable(\"is_document_type\",\"\") + \"\'.\";\n}\nif (row[baseTypeIdPosition].equals(\"cmis:folder\") && !getVariable(\"is_folder_type\",\"\").equals(\'Y\')) {\n  throw \"Base type field with value \'cmis:folder\' but \'is_folder_type\'=\'\" + getVariable(\"is_folder_type\",\"\") + \"\'.\";\n}\n\nvar query = \"\";\nquery += getCreateSqlForAllStaging();\nquery += getCreateSqlForAllDataMart();\n\n// ==============================================\n\nfunction getCreateSqlForAllStaging() {\n\n  var query = \"\";\n  query += getCreateSqlForStagingPartial(getStagingTableName(\"_partial\"));\n  query += getCreateSqlForStaging(getStagingTableName(\"\"));\n\n  return query;\n}\n\nfunction getStagingTableName(postfix) {\n\n  var tableName = \"stg_cmis_\";\n  if (getVariable(\"is_document_type\",\"\").equals(\'Y\')) {\n    tableName += \"documents\";\n  }\n  else if (getVariable(\"is_folder_type\",\"\").equals(\'Y\')) {\n    tableName += \"folders\";\n  }\n  tableName += \"_\" + getVariable(\"name\",\"\").replace(\":\", \"_\").trim();\n  if (tableName.length > parseInt(getVariable(\"tableNameMaxLength\",\"\")) - postfix.length) {\n    var prefix = \"_\" + getVariable(\"id\",\"\").trim();\n    tableName = tableName.substr(0, parseInt(getVariable(\"tableNameMaxLength\",\"\")) - postfix.length - prefix.length);\n    tableName += prefix;\n  }\n  tableName += postfix;\n\n  return tableName;\n}\n\nfunction getCreateSqlForStagingPartial(tableName) {\n\n  // Drop table command.\n  var query = \"\";\n  if (getVariable(\"is_force_creation\",\"\").equals(\'true\')) {\n    query += \"DROP TABLE IF EXISTS \" + tableName + \"; \";\n  }\n\n  // Create table definition.\n  query += \"CREATE TABLE \";\n  if (!getVariable(\"is_force_creation\",\"\").equals(\'true\')) {\n    query += \"IF NOT EXISTS \";\n  }\n  query += tableName + \" (\";\n  query += \"id int not null auto_increment, \";\n  query += \"alfresco_id smallint not null, \";\n  query += \"cmis_objectid varchar(255) not null, \";\n  query += \"cmis_name varchar(512) not null, \";\n  query += \"cmis_creationdate datetime not null, \";\n  query += \"cmis_lastmodificationdate datetime not null, \";\n  if (getVariable(\"is_document_type\",\"\").equals(\'Y\') || getVariable(\"is_aspect\",\"\").equals(\'Y\')) {\n    query += \"cmis_contentstreamlength int not null, \";\n  }\n\n  // Fields.\n  for (var i=0; i < getInputRowMeta().size(); ++i) {\n\n    var valueMeta = getInputRowMeta().getValueMeta(i);\n\n    if (!valueMeta.getName().startsWith(\"alfcmis:\") && !valueMeta.getName().startsWith(\"cmis:\")) {\n\n      query += valueMeta.getName().replace(\":\", \"_\") + \" \";\n\n      if (valueMeta.getType() == valueMeta.TYPE_BIGNUMBER) {\n        query += \"int \";\n      } else if (valueMeta.getType() == valueMeta.TYPE_BOOLEAN) {\n        query += \"char(1) \";\n      } else if (valueMeta.getType() == valueMeta.TYPE_DATE) {\n        query += \"datetime \";\n      } else if (valueMeta.getType() == valueMeta.TYPE_INTEGER) {\n        query += \"int \";\n      } else if (valueMeta.getType() == valueMeta.TYPE_NUMBER) {\n        query += \"int \";\n      } else {\n        query += \"varchar(512) \";\n      }\n      query += \", \";\n    }\n  }\n\n  // Primary key.\n  query += \"PRIMARY KEY (id), \";\n\n  // Foreign key.\n  query += \"CONSTRAINT FOREIGN KEY (alfresco_id) REFERENCES dm_dim_alfresco(id) ON DELETE CASCADE \";\n\n  // Ending of the queries.\n  query += \");\";\n\n  return query;\n}\n\nfunction getCreateSqlForStaging(tableName) {\n\n  // Drop table command.\n  var query = \"\";\n  if (getVariable(\"is_force_creation\",\"\").equals(\'true\')) {\n    query += \"DROP TABLE IF EXISTS \" + tableName + \"; \";\n  }\n\n  // Create table definition.\n  query += \"CREATE TABLE \";\n  if (!getVariable(\"is_force_creation\",\"\").equals(\'true\')) {\n    query += \"IF NOT EXISTS \";\n  }\n  query += tableName + \" (\";\n  query += \"id int not null, \";\n  query += \"alfresco_id smallint not null, \";\n  query += \"cmis_objectid varchar(255) not null, \";\n  query += \"cmis_name varchar(512) not null, \";\n  query += \"cmis_creationdate datetime not null, \";\n  query += \"cmis_lastmodificationdate datetime not null, \";\n  if (getVariable(\"is_document_type\",\"\").equals(\'Y\') || getVariable(\"is_aspect\",\"\").equals(\'Y\')) {\n    query += \"cmis_contentstreamlength int not null, \";\n  }\n\n  // Fields.\n  for (var i=0; i < getInputRowMeta().size(); ++i) {\n\n    var valueMeta = getInputRowMeta().getValueMeta(i);\n\n    if (!valueMeta.getName().startsWith(\"alfcmis:\") && !valueMeta.getName().startsWith(\"cmis:\")) {\n\n      query += valueMeta.getName().replace(\":\", \"_\") + \" \";\n\n      if (valueMeta.getType() == valueMeta.TYPE_BIGNUMBER) {\n        query += \"int \";\n      } else if (valueMeta.getType() == valueMeta.TYPE_BOOLEAN) {\n        query += \"char(1) \";\n      } else if (valueMeta.getType() == valueMeta.TYPE_DATE) {\n        query += \"datetime \";\n      } else if (valueMeta.getType() == valueMeta.TYPE_INTEGER) {\n        query += \"int \";\n      } else if (valueMeta.getType() == valueMeta.TYPE_NUMBER) {\n        query += \"int \";\n      } else {\n        query += \"varchar(512) \";\n      }\n      query += \", \";\n    }\n  }\n\n  // Tuple unique identifier.\n  query += \"tuple_id varchar(255) null, \";\n\n  // Primary key.\n  query += \"PRIMARY KEY (id), \";\n\n  // Foreign key.\n  query += \"CONSTRAINT FOREIGN KEY (alfresco_id) REFERENCES dm_dim_alfresco(id) ON DELETE CASCADE \";\n\n  // Ending of the queries.\n  query += \");\";\n\n  return query;\n}\n\nfunction getCreateSqlForAllDataMart() {\n\n  var dimTableName = getDataMartTableName(\"\");\n  var query = \"\";\n\n  // Drop table command.\n  if (getVariable(\"is_force_creation\",\"\").equals(\'true\')) {\n    query += \"DROP TABLE IF EXISTS \" + dimTableName + \"; \";\n  }\n\n  // Create table definition.\n  query += \"CREATE TABLE \";\n  if (!getVariable(\"is_force_creation\",\"\").equals(\'true\')) {\n    query += \"IF NOT EXISTS \";\n  }\n  query += dimTableName + \" (\";\n  query += \"id int not null auto_increment, \";\n  if (getVariable(\"is_document_type\",\"\").equals(\'Y\')) {\n    query += \"document_id int not null, \";\n  }\n  else if (getVariable(\"is_folder_type\",\"\").equals(\'Y\')) {\n    query += \"folder_id int not null, \";\n  }\n\n  // Fields.\n  for (var i=0; i < getInputRowMeta().size(); ++i) {\n\n    var valueMeta = getInputRowMeta().getValueMeta(i);\n\n    if (!valueMeta.getName().startsWith(\"alfcmis:\") && !valueMeta.getName().startsWith(\"cmis:\")) {\n\n      query += valueMeta.getName().replace(\":\", \"_\") + \" \";\n\n      if (valueMeta.getType() == valueMeta.TYPE_BIGNUMBER) {\n        query += \"int \";\n      } else if (valueMeta.getType() == valueMeta.TYPE_BOOLEAN) {\n        query += \"char(1) \";\n      } else if (valueMeta.getType() == valueMeta.TYPE_DATE) {\n        query += \"datetime \";\n      } else if (valueMeta.getType() == valueMeta.TYPE_INTEGER) {\n        query += \"int \";\n      } else if (valueMeta.getType() == valueMeta.TYPE_NUMBER) {\n        query += \"int \";\n      } else {\n        query += \"varchar(512) \";\n      }\n      query += \", \";\n    }\n  }\n\n  // Source identifier.\n  query += \"alfresco_id smallint not null, \";\n  query += \"src_id varchar(255) not null, \";\n\n  // Primary key.\n  query += \"PRIMARY KEY (id), \";\n\n  // Foreign key.\n  if (getVariable(\"is_document_type\",\"\").equals(\'Y\')) {\n    query += \"CONSTRAINT FOREIGN KEY (document_id) REFERENCES dm_dim_documents(id) ON DELETE CASCADE, \";\n  }\n  else if (getVariable(\"is_folder_type\",\"\").equals(\'Y\')) {\n    query += \"CONSTRAINT FOREIGN KEY (folder_id) REFERENCES dm_dim_folders(id) ON DELETE CASCADE, \";\n  }\n  query += \"CONSTRAINT FOREIGN KEY (alfresco_id) REFERENCES dm_dim_alfresco(id) ON DELETE CASCADE, \";\n\n  // Unique constraint.\n  query += \"UNIQUE KEY (alfresco_id, src_id) \"\n\n  // Ending of the queries.\n  query += \");\";\n\n  return query;\n}\n\nfunction getDataMartTableName(postfix) {\n\n  // Table name defintion.\n  var tableName = \"dm_dim_\";\n  if (getVariable(\"is_document_type\",\"\").equals(\'Y\')) {\n    tableName += \"documents\";\n  }\n  else if (getVariable(\"is_folder_type\",\"\").equals(\'Y\')) {\n    tableName += \"folders\";\n  }\n  tableName += \"_\" + getVariable(\"name\",\"\").replace(\":\", \"_\").trim();\n  if (tableName.length > parseInt(getVariable(\"tableNameMaxLength\",\"\")) - postfix.length) {\n    var prefix = \"_\" + getVariable(\"id\",\"\").trim();\n    tableName = tableName.substr(0, parseInt(getVariable(\"tableNameMaxLength\",\"\")) - postfix.length - prefix.length);\n    tableName += prefix;\n  }\n  tableName += postfix;\n\n  return tableName;\n}\n');
