INSERT INTO `R_STEP_ATTRIBUTE` (`ID_STEP_ATTRIBUTE`, `ID_TRANSFORMATION`, `ID_STEP`, `NR`, `CODE`, `VALUE_NUM`, `VALUE_STR`) VALUES (3852,14,261,0,'jsScript_name',0,'Script 1');
INSERT INTO `R_STEP_ATTRIBUTE` (`ID_STEP_ATTRIBUTE`, `ID_TRANSFORMATION`, `ID_STEP`, `NR`, `CODE`, `VALUE_NUM`, `VALUE_STR`) VALUES (3853,14,261,0,'jsScript_script',0,'// Staging tables name definition.\nstaging_table_name = \"stg_cmis_\";\nif (is_document_type.equals(\'Y\')) {\n  staging_table_name += \"documents\";\n}\nelse if (is_folder_type.equals(\'Y\')) {\n  staging_table_name += \"folders\";\n}\nelse if (is_aspect.equals(\'Y\')) {\n  staging_table_name += \"aspects\";\n}\nstaging_table_name += \"_\" + name.replace(\":\", \"_\").trim();\nif (staging_table_name.length > parseInt(getVariable(\"tableNameMaxLength\",\"\"))) {\n  var prefix = \"_\" + id.toString();\n  staging_table_name = staging_table_name.substr(0, parseInt(getVariable(\"tableNameMaxLength\",\"\")) - prefix.length);\n  staging_table_name += prefix;\n}\nvar staging_partial_table_name = staging_table_name;\nvar postfix = \"_partial\";\nif (staging_partial_table_name.length > parseInt(getVariable(\"tableNameMaxLength\",\"\")) - postfix.length) {\n  var prefix = \"_\" + id.toString();\n  staging_partial_table_name = staging_partial_table_name.substr(0, parseInt(getVariable(\"tableNameMaxLength\",\"\")) - postfix.length - prefix.length);\n  staging_partial_table_name += prefix;\n}\nstaging_partial_table_name += postfix;\n\n// Data Mart table name definition.\ndatamart_table_name = \"dm_dim_\";\nif (is_document_type.equals(\'Y\')) {\n  datamart_table_name += \"documents\";\n}\nelse if (is_folder_type.equals(\'Y\')) {\n  datamart_table_name += \"folders\";\n}\nelse if (is_aspect.equals(\'Y\')) {\n  datamart_table_name += \"aspects\";\n}\ndatamart_table_name += \"_\" + name.replace(\":\", \"_\").trim();\nif (datamart_table_name.length > parseInt(getVariable(\"tableNameMaxLength\",\"\"))) {\n  var prefix = \"_\" + id.toString();\n  datamart_table_name = datamart_table_name.substr(0, parseInt(getVariable(\"tableNameMaxLength\",\"\")) - prefix.length);\n  datamart_table_name += prefix;\n}\n');
